import React from "react";

function Footer() {
  return (
    <footer className="footer">
      <span>
        <a
          target="_blank"
          href="https://wing.comp.nus.edu.sg/"
          className="external_link_footer"
        >
          &nbsp; WING-NUS&nbsp;
        </a>
        &copy; Copyright 2020
      </span>
    </footer>
  );
}

export default Footer;
